import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import StudentTable from './StudentTable';

const App = () => {
  return (
    <BrowserRouter>
    <Routes>

      <Route path='/' element={<StudentTable/>}>    </Route>

    </Routes>
    </BrowserRouter>
  )
}

export default App
